OSM.Survey.getSchedulePropertyByName = function(props, sPropertyName, bStartsWith){ // 20170906 v7.51 - Scheduling hierarchy
    // filter properties for propery with passed-in name
    filteredProps = props.filter
    (
        function(prop)
        {
            // if property name should be equal to or start with passed-in name
            if (bStartsWith)
            {
                // filter for property where name  starts with passed-in name
                return prop.propertyName.substring(0,sPropertyName.length) === sPropertyName ;
            }
            // if property name should be equal to passed-in name
            else
            {
                // filter for property where name is equal to passed-in name
                return prop.propertyName === sPropertyName ;
            }
        }
    );

    // return result of filter
    return filteredProps ;
};

OSM.Survey.getScheduleProperties = function(props, aProperties, bStartsWith){   // 20170906 v7.51 - Scheduling hierarchy
    // loop through array with property names to check
    for(i=0; i<aProperties.length; i++)
    {
        // check if property exists
        filteredProps = OSM.Survey.getSchedulePropertyByName(props, aProperties[i], bStartsWith);

        // if property exists
        if (filteredProps && filteredProps.length)
        {
            // store value of property in SHELL_SCH# question.
            // store text "empty" if value is empty.
            OSM.Survey["SHELL_SCH" + (i + 1)].setComment((filteredProps[0].propertyValue.trim() !== "" ? filteredProps[0].propertyValue.trim() : "empty")) ;
        }
        // if property doesn't exist
        else
        {
            // store text "unknown" in SHELL_SCH# question.
            OSM.Survey["SHELL_SCH" + (i + 1)].setComment("unknown") ;
        }
    }
};

OSM.Survey.getScheduleSite = function(props){   // 20170906 v7.51 - Scheduling hierarchy

    var filteredProps;

    // WW site
    // Check if property "Country" exists, the first property of WW site
    filteredProps = OSM.Survey.getSchedulePropertyByName(props, "Country", false);
    // if propery exists then site is WW
    if (filteredProps && filteredProps.length)
    {
        // site is WW
        return "WW" ;
    }

    // China site
    // Check if property "地区（城市级别）Region (Tier)" exists, the first property of China site
    filteredProps = OSM.Survey.getSchedulePropertyByName(props, "地区（城市级别）Region (Tier)", false);
    // if propery exists then site is China
    if (filteredProps && filteredProps.length)
    {
        // site is China
        return "China" ;
    }

    // India site
    // Check if property "Office" exists, the second property of India site
    filteredProps = OSM.Survey.getSchedulePropertyByName(props, "Office", false);
    // if propery exists then site is WW
    if (filteredProps && filteredProps.length)
    {
        // site is India
        return "India" ;
    }

    // All other sites
    // Check if property "Region" exists, the first  property of all other sites
    // "Region" property can have translation, for example property's name is  "Region/Región". So check for property name starting with text "Region".
    filteredProps = OSM.Survey.getSchedulePropertyByName(props, "Region", true);
    // if propery exists then site is other site
    if (filteredProps && filteredProps.length)
    {
        // site is "other"
        return "other" ;
    }

    // if none of the properties was found, something is wrong.
    // Return "unknown"
    return "unknown" ;

};

OSM.Survey.setSchedulingHierarchyQuestions = function(){    // 20170906 v7.51 - Scheduling hierarchy

    var sSite = "";
    var aProperties ;

    // get inBoxManager (Inbox API)
    var inboxManager = OSM.Survey.get("activeEnvironment").get("inboxManager") ;

    // get custom properties of instance
    // getCustomProperties returns JavaScript Promise object
    var cps = inboxManager.getCustomProperties(OSM.Survey.get("surveyInstanceID")) ;

    // check the custom properties
    // use "then" method of Promise object
    cps.then
    (
        function(props) 
        {
            // The number and names of properties depend on site.
            // Site can only be determined by checking site specific Scheduling Hierarchy property...
            // Get site
            sSite = OSM.Survey.getScheduleSite(props) ;

            switch(sSite)
            {
                case "WW":
                    aProperties = ["Country", "Region", "Location"] ;
                    OSM.Survey.getScheduleProperties(props, aProperties, false);
                    break;

                case "China":
                    aProperties = ["地区（城市级别）Region (Tier)", "城市 City", "城市/执行公司 MGT REG"] ;
                    OSM.Survey.getScheduleProperties(props, aProperties, false);
                    break;

                case "India":
                    aProperties = ["Region", "Office", "Centre"] ;
                    OSM.Survey.getScheduleProperties(props, aProperties, false);
                    break;

                case "other":
                    aProperties = ["Region", "Location"] ;
                    OSM.Survey.getScheduleProperties(props, aProperties, true);
                    break;

                // if site is unknown, because specific custom property wasn't detected
                case "unknown":
                    // store text "unknown" in SHELL_SCH# questions
                    OSM.Survey.SHELL_SCH1.setComment("site not detected");
                    OSM.Survey.SHELL_SCH2.setComment("site not detected");
                    OSM.Survey.SHELL_SCH3.setComment("site not detected");
                    break;
            }

        } // end of function(props)
    ); // end cps.then
};

OSM.Survey.captureGeoLocationAccuracy = function () {   // 20170808 template v7.50 - GeoLocation accuracy
    // This should be done at start of last asked question in script.
    // set values for accuracy and timeout
    // default accuracy is 30 meters, default timeout is 300 seconds (5 minutes)
    var accuracy = 30, timeout = 300 ;

    // Start capture of GeoLocation and store result in variable.
    var locationResult = OSM.Survey.getAccurateLocationFix({"accuracy": accuracy, "timeout": timeout});

    // Store result of GeoLocation capture in questions
    locationResult.then( function(result)
    {
        OSM.Survey.SHELL_GEOLOCATION_OUTCOME.setAnswers("_" + result.outcome);
        OSM.Survey.SHELL_GEOLOCATION_LATITUDE.setComment(result.latitude);
        OSM.Survey.SHELL_GEOLOCATION_LONGITUDE.setComment(result.longitude);
        OSM.Survey.SHELL_GEOLOCATION_ACCURACY.setComment(result.accuracy);
        OSM.Survey.SHELL_GEOLOCATION_TIMESTAMP.setComment(result.timestamp);
    });

};

