OSM.Survey.trimString = function(inputString) {     // 20170808 template v7.50 - Update "this" to "OSM.Survey"
    return inputString.replace(/^\s+|\s+$/g, "");
};

OSM.Survey.getInterviewLength = function(startTime) {   // 20170808 template v7.50 - Update "this" to "OSM.Survey"

      var curTime = new Date().getTime();

      var elapsedtime = (curTime - startTime) / 1000;
      var min = Math.floor(elapsedtime / 60);
      var sec = Math.floor(elapsedtime % 60);

      return (sec > 29 ? min+1 : min);
};

OSM.Survey.getTime = function() {   // 20170808 template v7.50 - Update "this" to "OSM.Survey"
    var now     = new Date(); 
    var hour    = now.getHours();
    var minute  = now.getMinutes();
    var second  = now.getSeconds(); 

    if(hour.toString().length == 1) {
        hour = '0'+hour;
    }
    if(minute.toString().length == 1) {
        minute = '0'+ minute;
    }
    if(second.toString().length == 1) {
        second = '0'+ second;
    }
    return hour + ':' + minute + ':' + second;
};

OSM.Survey.getDate = function() {   // 20170808 template v7.50 - Update "this" to "OSM.Survey"
    var now     = new Date(); 
    var year    = now.getFullYear();
    var month   = now.getMonth()+1; 
    var day     = now.getDate();

    if(month.toString().length == 1) {
        month = '0'+ month;
    }
    if(day.toString().length == 1) {
        day = '0'+ day;
    }
    // 20161114 - amending return date format
    return year + '-' + month + '-' + day;
};

OSM.Survey.getRandomNumber = function(minVal, maxVal){  // 20170808 template v7.50 - Update "this" to "OSM.Survey"
    var rnd = 0;
    // 20171011 v7.52 - Update getRandomNumber to ensure maximum value doesn’t exceed 9999999999
    rnd = Math.floor(Math.random() * (maxVal - minVal + 1) + minVal);
    return rnd;
};

OSM.Survey.setShell_Tel = function(){   // 20170808 template v7.50 - Update "this" to "OSM.Survey"
      //20160701 - Converting this into a UDF that populates the comibined home & phone number
      // 20171024 v7.53 - Remove section SHELL_CLOSE
      var phoneQuest = OSM.Survey.SHELL_TEL;
      var phoneNum       = '';
      // 20171024 v7.53 - Change section SHELL_CLOSE into SHELL_BLOCK_TEL
      var homePhoneNum   = OSM.Survey.SHELL_BLOCK_TEL.SHELL_HOMETEL.getComment();
      var mobilePhoneNum = OSM.Survey.SHELL_BLOCK_TEL.SHELL_MOBTEL.getComment();

      homePhoneNum = OSM.Survey.trimString(homePhoneNum);
      if (homePhoneNum !== ''){
          phoneNum = homePhoneNum;
      }

      if (mobilePhoneNum !== ''){
          if (homePhoneNum !== ''){
              phoneNum += ' / ';
          }
          phoneNum += mobilePhoneNum;
      }
      phoneQuest.setComment(phoneNum);
};

