OSM.Survey.setShell_Address = function(){   // 20170808 template v7.50 - Update "this" to "OSM.Survey"
    // 20170207 - Concatenating shell address
    // 20170222 - fixing an issue with shell address not concatenated with a comma 
      // 20171024 v7.53 - Remove section SHELL_SECT_ADDRESS
      var addressQuest = OSM.Survey.SHELL_ADDRESS;
      var shellAddress = '';
      // 20171024 v7.53 - Change section SHELL_SECT_ADDRESS into SHELL_BLOCK_ADDRESS
      var houseNo   = OSM.Survey.SHELL_BLOCK_ADDRESS.SHELL_HOUSENO.getComment();
      var street = OSM.Survey.SHELL_BLOCK_ADDRESS.SHELL_STREET.getComment();
      var district = OSM.Survey.SHELL_BLOCK_ADDRESS.SHELL_DISTRICT.getComment();
      var town = OSM.Survey.SHELL_BLOCK_ADDRESS.SHELL_TOWN.getComment();
      var zip = OSM.Survey.SHELL_BLOCK_ADDRESS.SHELL_ZIP.getComment();

      if (houseNo !== ''){ 
          shellAddress = houseNo; 
      }

      if (street !== ''){
          if (shellAddress !== ''){ 
              shellAddress += ', '; 
          }
          shellAddress += street;
      }

      if (district !== ''){
          if (shellAddress !== ''){
              shellAddress += ', ';
          }
          shellAddress += district;
      }

      if (town !== ''){
          if (shellAddress !== ''){
              shellAddress += ', ';
          }
          shellAddress += town;
      }

      if (zip !== ''){
          if (shellAddress !== ''){
              shellAddress += ', ';
          }
          shellAddress += zip;
      }
      addressQuest.setComment(shellAddress);
};

