            var iteration = OSM.Survey._QC1_2a.getIteration(iterationName);

            switch(iterationName){
                case '_1':
                case '_2':

                    if(iteration._Qc2a.isAnswerSelected(['_208','_34','_35']))
                    {
                        arr_check = OSM.Survey.unionCategories(arr_check,iterationName);
                    }
                    break;
                case '_3':
                    if(iteration._Qc2a.isAnswerSelected(['_93']))
                    {
                        arr_check = OSM.Survey.unionCategories(arr_check,iterationName);
                    }
                    break;
                case '_4':

                    if(iteration._Qc2a.isAnswerSelected(['_15','_76','_92']))
                    {
                        arr_check = OSM.Survey.unionCategories(arr_check,iterationName);
                    }
                    break;
            }
        }

    });




    if(arr_check.length > 1)
    {
        if(count == 1)
        {
            return{
                status:false,
                message:"Phải chọn 2 Quảng Cáo"
            };
        }
    }


    if(count > 2)
    {
        return{
            status:false,
            message:"Chỉ được chọn 2 Quảng Cáo"
        };
    }



    return{
        status:true
    };
