OSM.Survey.valCheckCT4 = function(event){

    OSM.NotificationSystem.removeAllNotifications();
    var count = 0;
    var iterations = event.sourceElement.parent().parent().get('childNodes');

    iterations.forEach(function(iterator, key){

        if(iterator.get('isVisible'))
        {
            var iterationName = iterator.get('objectName');
            var iteration = event.sourceElement.parent().parent().getIteration(iterationName);

            if(parseInt(iteration._CT4_Num1.getComment()) < parseInt(iteration._CT4_Num2.getComment()))
            {
                count++;
            }else if (parseInt(iteration._CT4_Num2.getComment()) < parseInt(iteration._CT4_Num3.getComment())){
                count++;
            }else if (parseInt(iteration._CT4_Num3.getComment()) < parseInt(iteration._CT4_Num4.getComment())) {
                count++;
            }else if (parseInt(iteration._CT4_Num4.getComment()) < parseInt(iteration._CT4_Num5.getComment())) {
                count++;
            }
        }

    });

    if(count > 0)
    {
        return{
            status:false,
            message:"check logic Giá QUÁ RẺ < RẺ < MẮC < QUÁ MẮC"
        }
    }


    return{
        status:true
    };
};

