OSM.Survey.valCheckRID = function(event){

    var str_ID = OSM.Survey._RID.getComment();
    var err_num = 0;

    if(parseInt(str_ID) > 1000)
    {   
        switch (OSM.Survey._ResProvinces.getAnswers())
        {
            case '_1':
                err_num = Object.keys(obj_ID_HCM).indexOf(str_ID);
                break;
            case '_2':
                err_num = Object.keys(obj_ID_HN).indexOf(str_ID);
                break;
            case '_3':
                err_num = Object.keys(obj_ID_DN).indexOf(str_ID);
                break;
            case '_4':
                err_num = Object.keys(obj_ID_CT).indexOf(str_ID);
                break;
            case '_5':
                err_num = Object.keys(obj_ID_NT).indexOf(str_ID);
                break;
        }

        if(err_num == -1)
        {
            return{
                status:false,
                message:"Vui lòng kiểm tra lại ID ROTATION"
            };
        }
    }

    return{
        status:true
    };
};

OSM.Survey.valCheckRID = function(event){

    if (!OSM.Survey._ResProvinces.isAnswerSelected(['_1','_2']))
