                message: "Bạn đang nhập sai ID rotation, vui lòng kiểm tra lại"
            }
        }
    }
    else
    {
        if (event.sourceElement.isAnswerSelected(['_11','_12','_13','_14']))
        {
            return{
                status:false,
                message: "Bạn đang nhập sai ID rotation, vui lòng kiểm tra lại"
            }
        }
    }
    return{
        status:true
    }
};

