OSM.Survey.addEventListener("onBeforeClose", function(event){
    //attaching listener before we close the survey (on save) where we save new time length
    // 20160701 - Only re-calculate the interview length during entrance from mobile app, DO NOT calculate during portal access.
    // 20171221 v7.55 U92 - Add isDummyDataMode for SHELL_INT_LENGTH generate value when run Dummy Data 
    if (OSM.Survey.get('activeEnvironment').isMobiAudit() || OSM.Survey.get('activeEnvironment').get('isDummyDataMode'))
    {
        //getting diff now - startime
        var endTime = new Date().getTime() - startSessionTime;

        //calculating rouded time in minutes
        var timeSeconds = (endTime + prevTime) / 1000;
        var roundTimeMinutes = Math.floor(timeSeconds / 60);
        var roundTimeSeconds = Math.floor(timeSeconds % 60);
        roundTimeMinutes = roundTimeSeconds >= 30 ? roundTimeMinutes + 1 : roundTimeMinutes;

        //setting new interview length in minutes round to 30 seconds
        timeQuestion.setComment(roundTimeMinutes);

        // 20170315 Template v0 41 - Update 82
        // Use new Context API to retrieve user login name. Convert to lower case for consistency.
        // 201800802 - v7.62 - Comment old set SHELL_INTERVIEWER_LOGIN
        //OSM.Survey.SHELL_INTERVIEWER_LOGIN.setComment( OSM.Survey.get("userContext").get("login").toLowerCase() );

        // 20180129 v7.56 U93 - Set value System_Date, System_TimeIn and System_TimeOut 
        OSM.Survey.System_Date.setComment(OSM.Survey.getDate());
        OSM.Survey.System_TimeIn.setComment(OSM.Survey.getTime());
        OSM.Survey.System_TimeOut.setComment(OSM.Survey.getTime());
    }
    switch (RM.OSM.PlatformSpecifics.platform){
    // 201800802 - v7.62 - Checking platform to store interviewer name
    case "web": 
        if(SB){
            // Web Survey Builder
        }
        else if(SBP){
            // Web Survey Builder Preview
        }
        else if(ITS){
            // Web Instance Survey
            // 201800802 - v7.62 - Store interviewer name on portal
            // Use new Context API to retrieve user login name & convert to lower case for consistency.
            OSM.Survey.SHELL_INTERVIEWER_LOGIN.setComment( OSM.Survey.get("userContext").get("login").toLowerCase() );
        }
        else if(SP){
            // Web Preview 
        }
        else{
            // Web Edit
        }
        break;
    case "android": 
        // Mobile device (android)
        // 201800802 - v7.62 - Store interviewer name on device 
        // Use new Context API to retrieve user login name & convert to lower case for consistency.
        OSM.Survey.SHELL_INTERVIEWER_LOGIN.setComment( OSM.Survey.get("userContext").get("login").toLowerCase() );
        break;
    case "w8app":
        // Mobile device (windows)
        // 201800802 - v7.62 - Store interviewer name on device
        // Use new Context API to retrieve user login name & convert to lower case for consistency.
        OSM.Survey.SHELL_INTERVIEWER_LOGIN.setComment( OSM.Survey.get("userContext").get("login").toLowerCase() );
        break;
}

    // 20160701 - setting shell_tel - even without clicking Next button
    OSM.Survey.setShell_Tel();
    // 20170602 - setting respondent_address - even withouot clicking Next button
    OSM.Survey.setShell_Address();

    // 201800802 - v7.62 - Auto submit for complete on portal
    // Check validate
    var isValid = OSM.Survey.isValid();
    if(isValid){  
        OSM.Survey.setCloseHandler(OSMSurveyRenderingHelper.submitHandler);
        OSM.Survey.save(true);
    }

});

