OSM.Survey.SHELL_AGE.addEventListener("onExit", function(event) {

    var exactAge = 0, exactAgeGroup = ['_A7'];

    try
    {
        var objExactAge = OSM.Survey.SHELL_AGE;
        var ageRecodedQuest = OSM.Survey.SHELL_AGE_RECODED;

        var exactAge = parseInt(objExactAge._A1.getComment());

        switch (true)
        {   //20160701 - adding an additional age band. 
            //20160713 - amending the additional age band to _A0 for continuity purpose.
            case (exactAge >= 10 && exactAge <= 15):
                ageRecodedQuest.setAnswers(['_A0']);
                break;
            case (exactAge >= 16 && exactAge <= 24):
                ageRecodedQuest.setAnswers(['_A1']);
                break;
            case (exactAge >= 25 && exactAge <= 34):
                ageRecodedQuest.setAnswers(['_A2']);
                break;
            case (exactAge >= 35 && exactAge <= 44):
                ageRecodedQuest.setAnswers(['_A3']);
                break;
            case (exactAge >= 45 && exactAge <= 54):
                ageRecodedQuest.setAnswers(['_A4']);
                break;
            case (exactAge >= 55 && exactAge <= 64):
                ageRecodedQuest.setAnswers(['_A5']);
                break;
            case (exactAge >= 65):
                ageRecodedQuest.setAnswers(['_A6']);
                break;
            default: 
                ageRecodedQuest.setAnswers(['_A7']);  
        }
    }
    catch(e)
    {
        ageRecodedQuest.setAnswers(['_A7']);
    }

    //OSM.Survey.initializeQuestion(OSM.Survey.SHELL_AGE_RECODED, exactAgeGroup);

    if(OSM.Survey.SHELL_AGE_RECODED.isAnswerSelected(['_A7']))
    {
        OSM.Survey.get('navigator').goTo(OSM.Survey._ChamDut);
    }
    else
    {

        if(exactAge >= 18 && exactAge <= 50)
        {
            var currentDate = new Date(OSM.Survey._STARTDATE.getComment());

            OSM.Survey._YearOfBirth.setComment(currentDate.getFullYear() - exactAge);
            OSM.Survey._Age.setComment(exactAge);

            var ageGroupRequest = OSM.Survey._AgeGroup;

            switch(true)
            {
                case (exactAge >= 18 && exactAge <= 25):
                    ageGroupRequest.setAnswers(['_2']);
                    break;    
                case (exactAge >= 26 && exactAge <= 30):
                    ageGroupRequest.setAnswers(['_3']);
                    break;
                case (exactAge >= 31 && exactAge <= 35):
                    ageGroupRequest.setAnswers(['_4']);
                    break;
                case (exactAge >= 36 && exactAge <= 40):
                    ageGroupRequest.setAnswers(['_5']);
                    break;
                case (exactAge >= 41 && exactAge <= 45):
                    ageGroupRequest.setAnswers(['_6']);
                    break;
                case (exactAge >= 46 && exactAge <= 50):
                    ageGroupRequest.setAnswers(['_7']);
                    break;
                default:
                    ageGroupRequest.setAnswers(['_98']);
            }

            //Quota DoTuoi
            OSM.Survey._Quota_AgeGroup.setAnswers(ageGroupRequest.getAnswers());
        }
        else
        {
            OSM.Survey.get('navigator').goTo(OSM.Survey._ChamDut);
        }
    }
});

OSM.Survey._ResProvinces.addEventListener("onInputChange", function(event) {

    if(OSM.Survey.countCategories(OSM.Survey._ResProvinces.getAnswers()) !== 0)
    {
        OSM.Survey._ResDistricts.show();  

        var objDistricts = {}; 

        var i = 1;
        var arr_districts = new Array(); 

        //Get resource with GUID
        var tbl_guid = "6AA35B5A-245C-4ECF-B0C9-46302162BFC3";
        var datasetResource = new RM.OSM.Survey.Resource.DataSetResource(tbl_guid); 

        datasetResource.select("Districts", "ProvinceID == " + event.sourceElement[event.sourceElement.getAnswers()].get('objectName').replace('_','')).then(function(data){

            var row = data[0];

            objDistricts = JSON.parse('{' + row["Districts"] + '}');

            for(var d in objDistricts)
            {
                OSM.Survey.setInsert("_DistrictLabel" + (i.toString().length == 1 ? "0" + i.toString() : i.toString()), objDistricts[d]);

                arr_districts.push("_" + i.toString());
                i++;
            }

            OSM.Survey.initializeQuestion(OSM.Survey._ResDistricts, arr_districts);

            OSM.Survey.initializeQuestion(OSM.Survey._Quota_City, event.sourceElement.getAnswers());

        }).catch(function(error){

            objDistricts = JSON.parse('{' + '"_701":"Quận Dương Kinh","_702":"Quận Đồ Sơn","_703":"Quận Hải An","_704":"Quận Kiến An","_705":"Quận Hồng Bàng","_706":"Quận Ngô Quyền","_707":"Quận Lê Chân","_708":"Huyện An Dương","_709":"Huyện An Lão","_710":"Huyện đảo Bạch Long Vĩ","_711":"Huyện đảo Cát Hải","_712":"Huyện Kiến Thụy","_713":"Huyện Tiên Lãng","_714":"Huyện Vĩnh Bảo","_715":"Huyện Thủy Nguyên"' + '}');

            for(var d in objDistricts)
            {
                OSM.Survey.setInsert("_DistrictLabel" + (i.toString().length == 1 ? "0" + i.toString() : i.toString()), objDistricts[d]); 

                arr_districts.push("_" + i.toString());
                i++;
            }

            OSM.Survey.initializeQuestion(OSM.Survey._ResDistricts, arr_districts);

            OSM.Survey.initializeQuestion(OSM.Survey._Quota_City, event.sourceElement.getAnswers());
        });
    }
});

OSM.Survey._ResDistricts.addEventListener("onInputChange", function(event) { 

    if(event.sourceElement.isAnswered())
    {
        OSM.Survey._ResDistrictSelected.setComment(OSM.Survey._ResDistricts[OSM.Survey._ResDistricts.getAnswers()].get('text').getText()); 

        OSM.Survey._ResWards.show();  

        var objWards = {}; 

        var tbl_guid = "03A9D565-891E-4E92-81C3-70C1016D8A03";
        var datasetResource = new RM.OSM.Survey.Resource.DataSetResource(tbl_guid); 

        var districtid = OSM.Survey._ResProvinces[OSM.Survey._ResProvinces.getAnswers()].get('objectName') + (event.sourceElement[event.sourceElement.getAnswers()].get('objectName').replace('_', '').length == 1 ? "0" : "") + event.sourceElement[event.sourceElement.getAnswers()].get('objectName').replace('_', ''); 

        var i = 1;
        var arr_wards = new Array(); 

        datasetResource.select("Wards", "DistrictID == '" + districtid + "'").then(function(data){ 

            var row = data[0]; 

            objWards = JSON.parse('{' + row["Wards"] + '}'); 

            for(var d in objWards)
            {
                OSM.Survey.setInsert("_WardLabel" + (i.toString().length == 1 ? "0" + i.toString() : i.toString()), objWards[d]); 

                arr_wards.push("_" + i.toString());
                i++;
            } 

            OSM.Survey.initializeQuestion(OSM.Survey._ResWards, arr_wards);
        }).catch(function(error){ 

            objWards = JSON.parse('{' + '"_70101":"Phường Đa Phúc","_70102":"Phường Hưng Đạo","_70103":"Phường Anh Dũng","_70104":"Phường Hải Thành","_70105":"Phường Hoà Nghĩa","_70106":"Phường Tân Thành"' + '}'); 

            objWards = JSON.parse('{' + row["Wards"] + '}'); 

            for(var d in objWards)
            {
                OSM.Survey.setInsert("_WardLabel" + (i.toString().length == 1 ? "0" + i.toString() : i.toString()), objWards[d]); 

                arr_wards.push("_" + i.toString());
                i++;
            } 

            OSM.Survey.initializeQuestion(OSM.Survey._ResWards, arr_wards);
        });
    }
});

