OSM.Survey._SEC_RESD_ADDRESS.addEventListener("onExit", function(event) {

    if(OSM.Survey.get('activeEnvironment').isMobiAudit())
    {
        if(OSM.Survey._ResProvinces.getAnswers().length > 0 && OSM.Survey._ResDistricts.getAnswers().length > 0)
        {
            OSM.Survey._ResDistrictSelected.setComment(OSM.Survey._ResDistricts[OSM.Survey._ResDistricts.getAnswers()].get('text').getText());

            var objectnameProvince = OSM.Survey._ResProvinces[OSM.Survey._ResProvinces.getAnswers()].get('objectName');
            var objectnameDistrict = OSM.Survey._ResDistricts[OSM.Survey._ResDistricts.getAnswers()].get('objectName');

            var objectnameDistrictSelected = objectnameProvince;

            if(objectnameDistrict.length === 2)
            {
                objectnameDistrictSelected += "0" + objectnameDistrict.replace('_','');
            }
            else
            {
                objectnameDistrictSelected += objectnameDistrict.replace('_','');
            }

            OSM.Survey.initializeQuestion(OSM.Survey._Quota_District, objectnameDistrictSelected);
        }
    }
});

