    console.log("Q2c")

    var arr_List = OSM.Survey.unionCategories(OSM.Survey._Q2a.getAnswers(), OSM.Survey._Q2b.getAnswers(), OSM.Survey._Q2n1.getAnswers(), OSM.Survey._Q2n2.getAnswers(), OSM.Survey._Q2c.getAnswers());
    var arrList = OSM.Survey.differenceArrListCatsWith(arr_List, ['_201','_204','_205','_206','_207','_208','_44','_99']);

    if(arrList.length == 0)
    {
        OSM.Survey.get('navigator').goTo(OSM.Survey._ChamDut);       
    }

    OSM.Survey.showDialogQuestion(OSM.Survey._Q2_Total, arrList);

    OSM.Survey._Info_AQ.hide();
    OSM.Survey._AQ1.hide();
    OSM.Survey._AQ4a.hide();
    var arrListQres = ['_AQ2','_AQ3','_AQ4','_AQ5a'];
    OSM.Survey.hideQuestions(arrListQres);


    if (OSM.Survey._SEC_RESD_ADDRESS._ResProvinces.isAnswerSelected(['_1','_2']))
    {
        OSM.Survey._Info_AQ.show();
        OSM.Survey._AQ1.show();
        OSM.Survey._AQ4a.show();
        OSM.Survey.showQuestions(arrListQres);
    }

console.log("Q2c")

    arrListQres = ['_Info_SH','_SH1','_SH2','_SH3'];
    OSM.Survey.hideQuestions(arrListQres);

