OSM.Survey.valCheckAQ5a =function(event){

    if (event.sourceElement.isAnswerSelected(['_1']) && event.sourceElement.isAnswerSelected(['_3']))
    {
        return{
            status:false,
            message:"Không được chọn 1 và 3 cùng lúc"
        }
    }
    if (event.sourceElement.isAnswerSelected(['_4']) && event.sourceElement.isAnswerSelected(['_5']))
    {
        return{
            status:false,
            message:"Không được chọn 4 và 5 cùng lúc"
        }
    }

    return{
        status:true
    }
};

