                {
                    OSM.Survey.initializeQuestion(OSM.Survey._CP.getIteration('_1')._Campain,"_"+row["Campaign_1"].toString());
                    i++;
                    strRotation += "Campaign " + row["Campaign_1"].toString();
                }

                //alert("line x2")
                if (row["Campaign_2"] != null)
