OSM.Survey._LoaiPhieu.addEventListener("onExit", function (event){

        //SET QUOTAS
        if(OSM.Survey._LoaiPhieu.isAnswerSelected(['_3']))
        {
            OSM.Survey._Quota_City.clearAnswers();
            OSM.Survey._Quota_Area.clearAnswers();
            OSM.Survey._Quota_Gender.clearAnswers();
            OSM.Survey._Quota_AgeGroup.clearAnswers();
            OSM.Survey._Quota_User.clearAnswers();
            OSM.Survey._Quota_Class.clearAnswers();
            OSM.Survey._Quota_Q2k.clearAnswers();
            OSM.Survey._Quota_Digital.clearAnswers();
            OSM.Survey._Quota_District.clearAnswers();
        }else {

            OSM.Survey._DP._INCOME.setComment(OSM.Survey._SEC_INCOME._HouseHoldIncome.get('answerSet')[OSM.Survey._SEC_INCOME._HouseHoldIncome.getAnswers()].get('text').getText());
            //OSM.Survey._DP._MARRIED.setComment(OSM.Survey._Married_Q7.get('answerSet')[OSM.Survey._Married_Q7.getAnswers()].get('text').getText());
            //OSM.Survey._DP._EDUCATION.setComment(OSM.Survey._Education.get('answerSet')[OSM.Survey._Education.getAnswers()].get('text').getText());

            /*if(OSM.Survey._Occupation.isAnswerSelected(['_97'])){
                OSM.Survey._DP._OCCUPATION.setComment(OSM.Survey._Occupation_Q9.get('answerSet')[OSM.Survey._Occupation_Q9.getAnswers()].getComment());
            } else {
                OSM.Survey._DP._OCCUPATION.setComment(OSM.Survey._Occupation_Q9.get('answerSet')[OSM.Survey._Occupation_Q9.getAnswers()].get('text').getText());
            }*/

            OSM.Survey._DP._OCCUPATION.setComment(OSM.Survey._SEC_DEMOGRAPHIC._SEC_OCCUPATION._Occupation_NV_Text.getComment());

            if(OSM.Survey._Q2g.isAnswerSelected(['_971','_972','_973','_974','_975','_976','_977','_978','_979','_9710','_9711'])){
                OSM.Survey._DP._BUMO.setComment(OSM.Survey._Q2g.get('answerSet')[OSM.Survey._Q2g.getAnswers()].getComment());
            } else {
                OSM.Survey._DP._BUMO.setComment(OSM.Survey._Q2g.get('answerSet')[OSM.Survey._Q2g.getAnswers()].get('text').getText());
            }
        }

        var endInterviewDate = new Date();

        var prevenddate = OSM.Survey._ENDDATE.getComment();

        if(prevenddate === '')
        {
            OSM.Survey._ENDDATE.enableComment();
            OSM.Survey._ENDDATE.setComment(OSM.Survey.getMyDate(endInterviewDate, "YYYY-MM-DD"));
            OSM.Survey._ENDDATE.disableComment();
        }

        var prevendtime = OSM.Survey._ENDTIME.getComment();

        if(prevendtime === '')
        {
            OSM.Survey._ENDTIME.enableComment();
            OSM.Survey._ENDTIME.setComment(OSM.Survey.getMyTime(endInterviewDate));
            OSM.Survey._ENDTIME.disableComment();

            //alert(OSM.Survey.spandate("2016-10-11","2016-10-12","00:10:59","23:15:30"));

            var str_spend_date = OSM.Survey.spendDate(OSM.Survey._STARTDATE.getComment(), OSM.Survey._ENDDATE.getComment(), OSM.Survey._STARTTIME.getComment(), OSM.Survey._ENDTIME.getComment())

            OSM.Survey._SPANTIME.enableComment();
            OSM.Survey._SPANTIME.setComment(str_spend_date);
            OSM.Survey._SPANTIME.disableComment();

            OSM.Survey._TOTALTIME.enableComment();
            OSM.Survey._TOTALTIME.setComment(OSM.Survey.totalTime(str_spend_date));
            OSM.Survey._TOTALTIME.disableComment();
        }
    });

