OSM.Survey.SHELL_INTRO_GDPR.addEventListener('onExit', function(e){
// 20180515 - v7.60 U97 - screenout survey if answer is No
if(OSM.Survey.SHELL_INTRO_GDPR.isAnswerSelected("_A2")){

    var text = "The respondent indicated that he/she is not happy to proceed with the interview.";

    OSM.NotificationSystem.notifyModal(RM.Utils.getGlobalizedText(text, OSM.Survey, RM.Utils.literalTypes.survey));

    setTimeout(function()
    {      
