OSM.Survey.valCheckRESID =function(event){

    OSM.NotificationSystem.removeAllNotifications()

    var id = OSM.Survey._RID.getComment();
    var err = false;

    var sub = "_"+id.substring(0,1)

    console.log("check id")

    if (!OSM.Survey._SEC_RESD_ADDRESS._ResProvinces.isAnswerSelected(sub))
    {
        err = true;
    }


    if (err)
    {
        return{
            status:false,
            message:"PVV kiểm tra lại: ID không khớp với tỉnh/thành phố đã chọn"
        }
    }

    return{
        status:true
    }
};

OSM.Survey.addEventListenersToElements(["_Campain"], "onNext",function(event){
