OSM.Survey.addEventListenersToElements(["_Q2i_Codes"], "onInputChange", function(event){
    var num_100 = 0;
    var num_percent = 0;
    var iterations = OSM.Survey._Q2i.get('childNodes');

    iterations.forEach(function(iterator, key){

        if(iterator.get('isVisible'))
        {
            var iterationName = iterator.get('objectName');
            var iteration = OSM.Survey._Q2i.getIteration(iterationName);

            if (iteration._Q2i_Codes.getComment().length > 0 )
            {
                num_100 = num_100 + parseInt(iteration._Q2i_Codes.getComment());
            }
        }
    });  

    num_percent = 100 - num_100;

    OSM.Survey.setInsert("Lbl_Percent", num_percent.toString());

});

