OSM.Survey.addEventListenersToElements(["_TP1_678"],"onExit",function(event){

    var count = 0;
    var arrCatsList = new Array();
    var iteration = event.sourceElement.parent().parent().parent();

    iteration._Loop_TP2678.hide();
    iteration._TP4_TP3.hide();


    var iterations = event.sourceElement.parent().parent().get('childNodes');

    iterations.forEach(function(iterator, key){

        if(iterator.get('isVisible'))
        {
            var iterationName = iterator.get('objectName');
            var iteration = event.sourceElement.parent().parent().getIteration(iterationName);

            if(iteration._TP1_678.isAnswerSelected(['_1']))
            {
                arrCatsList.push(iterationName);
            }

        }

    });


    var arr_TP1 = new Array();
    var iterations_2 = OSM.Survey._CP_678.get('childNodes');

    iterations_2.forEach(function(iterator_2, index) {

        if(iterator_2.get('isVisible'))
        {

            var iterationName_2 = iterator_2.get('objectName');
            var iteration_2 = OSM.Survey._CP_678.getIteration(iterationName_2);

            if(iterationName_2 == '_6')
            {

                var iterations_3 = iteration_2._Loop_TP1678.get('childNodes');

                iterations_3.forEach(function(iterator_3, key){

                    if(iterator_3.get('isVisible'))
                    {
                        var iterationName_3 = iterator_3.get('objectName');
                        var iteration_3 = iteration_2._Loop_TP1678.getIteration(iterationName_3);

                        if(iterationName_3 == '_2')
                        {
                            if(iteration_3._TP1_678.isAnswerSelected(['_1']))
                            {
                                arr_TP1.push('_2');
                            }
                        }
                        if(iterationName_3 == '_8')
                        {
                            if(iteration_3._TP1_678.isAnswerSelected(['_1']))
                            {
                                arr_TP1.push('_8');
                            }
                        }
                    }              
                });

            }

        }
    });

    if(event.sourceElement.parent().parent().parent().get('objectName') == '_6')
    {
        if(arr_TP1.length > 0 )
        {
            iteration._TP4_TP3.show();
            iteration._TP4_TP3.filterIterations(arr_TP1);
        }
    }


    if(arrCatsList.length  > 0)
    {
        iteration._Loop_TP2678.show();
        iteration._Loop_TP2678.filterIterations(arrCatsList);
    }



});

