OSM.Survey.addEventListenersToElements(["_PR_1"],"onExit", function(event){

    OSM.Survey.stopSilentAudioRecording();
    var iteration = event.sourceElement.parent();
    iteration._PR_2.hide();
    iteration._PR_3.hide();
    iteration._PR_4.hide();

    if(event.sourceElement.isAnswerSelected(['_1']))
    {
        iteration._PR_2.show();


        iteration._PR_3.show();
        iteration._PR_4.show();


    }

});

OSM.Survey.addEventListenersToElements(["_PR_3"],"onExit", function(event){

    var iteration = event.sourceElement.parent();
    iteration._PR_4.hide();

    if(event.sourceElement.isAnswerSelected(['_2']))
    {
            iteration._PR_4.show();
    }

});

OSM.Survey.addEventListenersToElements(["_PA1_Codes"],"onExit",function(event){

    OSM.Survey._PA2.hide();
    var arrCatsList = new Array();

   var iterations = event.sourceElement.parent().parent().get('childNodes');

   iterations.forEach(function(iterator, key){

       if(iterator.get('isVisible'))
       {
            var iterationName = iterator.get('objectName');
            var iteration =  event.sourceElement.parent().parent().getIteration(iterationName);


            if(iterationName == '_1')
            {
                if(iteration._PA1_Codes.isAnswerSelected(['_2']) && OSM.Survey._Q2d.isAnswerSelected(['_25']))
                {
                    arrCatsList.push(iterationName);
                }
            }
            if(iterationName == '_2')
            {
                if(iteration._PA1_Codes.isAnswerSelected(['_2']) && OSM.Survey._Q2d.isAnswerSelected(['_104']))
                {
                    arrCatsList.push(iterationName);
                }
            }
            if(iterationName == '_3')
            {
                if(iteration._PA1_Codes.isAnswerSelected(['_2']) && OSM.Survey._Q2d.isAnswerSelected(['_93']))
                {
                    arrCatsList.push(iterationName);
                }
            }
            if(iterationName == '_4')
            {
                if(iteration._PA1_Codes.isAnswerSelected(['_2']) && OSM.Survey._Q2d.isAnswerSelected(['_21']))
                {
                    arrCatsList.push(iterationName);
                }
            }
       }

   });


   if(arrCatsList.length > 0)
   {
        OSM.Survey._PA2.show();
        OSM.Survey._PA2.filterIterations(arrCatsList);
   }


});

OSM.Survey.addEventListenersToElements(["_PA3_1_NEW"],"onEntrance",function(event){

    iteration = event.sourceElement.parent();
    iterationName = iteration.get('objectName');

    collectionName = iteration._Collection.isAnswerSelected(['_1']) ? "PA_Collection1_122022" : "PA_Collection2_122022"

    OSM.Survey.initializeQuestion(iteration._Order,iterationName);
    OSM.Survey.setInsert("lbl_hinhPA",collectionName);

});

OSM.Survey.addEventListenersToElements(["_PA3_1_NEW"],"onNext",function(event){

    iteration = event.sourceElement.parent();
    iterationName = iteration.get('objectName');
    iterationLabel = iteration._Collection.get('answerSet')[iteration._Collection.getAnswers()].get('text').getText();

    iteration._PA3_2_NEW.hide();

    if (event.sourceElement.isAnswerSelected(['_1']))
    {
        OSM.Survey.setInsert("lbl_TP3_3","");
        iteration._PA3_2_NEW.show();
    }
    else
    {
        OSM.Survey.setInsert("lbl_TP3_3","Đây là bộ sưu tập "+ iterationLabel +" được ra mắt gần đây. Bạn có cân nhắc sẽ tìm mua bộ sưu tập này của "+ iterationLabel +" không? (SA)");
    }

    //OSM.Survey.setInsert("lbl_TP3_3","");

});

OSM.Survey.addEventListenersToElements(["_PA3_2_NEW"],"onNext",function(event){

    iteration = event.sourceElement.parent();
    iterationName = iteration.get('objectName');
    iterationLabel = iteration._Collection.isAnswerSelected(['_1']) ? "Bia Saigon Lager" : "Bia Saigon Special"

    if (event.sourceElement.isAnswerSelected(['_1']))
    {
        OSM.Survey.setInsert("lbl_TP3_3","Bạn có tiếp tục tìm mua bộ sưu tập này của "+ iterationLabel + " không? (SA)");
    }
    else
    {
        OSM.Survey.setInsert("lbl_TP3_3","Bạn có cân nhắc sẽ tìm mua bộ sưu tập này của "+ iterationLabel + " không? (SA)");
    }

    //OSM.Survey.setInsert("lbl_TP3_3","");

});
